Proxy Init is an init container that establishes an iptables rule to redirect all IMDS requests from 169.254.169.254 to the proxy server by running the following command: PROXY_PORT=${PROXY_PORT:-8000}
METADATA_IP=${METADATA_IP:-169.254.169.254}
METADATA_PORT=${METADATA_PORT:-80} # Forward outbound traffic for metadata endpoint to proxy
iptables -t nat -A OUTPUT -p tcp -d "${METADATA_IP}" --dport "${METADATA_PORT}" -j REDIRECT --to-port "${PROXY_PORT}"
